import SHOP_DATA from './shop.data';

const INITIAL_STATE = {
	collections: SHOP_DATA
};

const ShopReducer = (state=INITIAL_STATE) => {
	switch (action.type) {
		default:
		  return state;
	}
}

export default ShopReducer;
